import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getGivenOffers } from "../../redux/actions/givenOffers";

function GivenOffers() {
  const givenOfferedProducts = useSelector((state) => state.givenOffers.givenOffers.data.product);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getGivenOffers());
  }, []);
  console.log({ givenOfferedProducts });
  return (
    <div>
      <h1>Given offers</h1>
    </div>
  );
}

export default GivenOffers;
